import React from 'react';

function Home() {
	return (
		<div className="home">
			<div class="container-fluid">
				<div class="col-lg-5">
					<br></br>
					<h1>Home</h1>
					<p>Welcome to Dogs4All!</p>
				</div>
			</div>
		</div>
		);
}
export default Home;
